import { Parallax } from 'react-parallax';

const ParallaxImage = () => (
    <Parallax blur={10} bgImage= "../images/profile_pic.jpeg" bgImageAlt="profile pic" strength={200} >
        <div style={{height: 100}}>
            <h1>hello</h1>
        </div>

    </Parallax>
);

export default ParallaxImage
